import 'package:flutter/material.dart';

class Cheatmeal extends StatefulWidget {
  const Cheatmeal({super.key});

  @override
  State<Cheatmeal> createState() => _CheatmealState();
}

class _CheatmealState extends State<Cheatmeal> {
List bulkList =[
  Diet(food: 'Burger', calories: '500', time: 'Snack',FoodUrl: 'data:image/jpeg;base64,'),
  Diet(food: 'Ice Cream', calories: '300', time: 'Snack', FoodUrl: 'data:image/jpeg;base64,'),
  Diet(food: 'Grilled Chicken', calories: '300', time: 'Lunch', FoodUrl: 'data:image/jpeg;base64,'),
  Diet(food: ' Peanut Butter & Whole Wheat Bread', calories: '250', time: 'Snack', FoodUrl: 'data:image/jpeg;base64,'),
Diet(food: 'Pizza', calories: '90', time: 'Snack', FoodUrl: 'data:image/jpeg;base64,'),
Diet(food: 'Protein Shake', calories: '200', time: 'Dinner', FoodUrl: 'data:image/jpeg;base64,'),

Diet(food: 'Oatmeal with nuts and Fruits', calories: '150', time: 'Dinner', FoodUrl: 'data:image/jpeg;base64,')






];



  @override
  Widget build(BuildContext context) {

    Widget  Bulks(){
      return ListView.builder(
        itemCount: bulkList.length,
        itemBuilder: (context,index){
        final bulkFoods=bulkList[index];
        return Padding(
          padding: const EdgeInsets.all(10),
          child: Card(
            
            color: Colors.white,
            child: ListTile(
              leading: SizedBox(
                height: 60,
                width: 60,
                child: Image.network(bulkFoods.FoodUrl),
          
              ),
              title: Text(bulkFoods.food),
              trailing: Text(bulkFoods.calories),
              subtitle: Text(bulkFoods.time),
            ),
          ),
        );
      });
    }
    return  Scaffold(
      backgroundColor: Colors.white,
body: Padding(
  padding: const EdgeInsets.all(8.0),
  child: Bulks(),
),
    );
  }
}
